trait TypedResult { this: Result =>
  def head[T](implicit m: Manifest[T]): T = {
    hasNext match {
      case true =>
        next
        val v = if (m.toString.startsWith("scala.Tuple")) typedRow[T] else typed[T](0)
        close
        v
      case false => throw new NoSuchElementException("No rows in result")
    }
  }
  def headOption[T](implicit m: Manifest[T]): Option[T] = {
    try {
      Some(head[T])
    } catch {
      case e: NoSuchElementException => None
    }
  }
  def unique[T](implicit m: Manifest[T]): T = {
    hasNext match {
      case true =>
        next
        val v = if (m.toString.startsWith("scala.Tuple")) typedRow[T] else typed[T](0)
        if (hasNext) {
          close; error("More than one row for unique result")
        } else v
      case false => error("No rows in result")
    }
  }
  def uniqueOption[T](implicit m: Manifest[T]): Option[T] = {
    hasNext match {
      case true =>
        next
        val v = if (m.toString.startsWith("scala.Tuple")) typedRow[T] else typed[T](0)
        if (hasNext) {
          close; error("More than one row for unique result")
        } else Some(v)
      case false => None
    }
  }

  def list[T](implicit m: Manifest[T]) = this.map(r => typedRow[T]).toList

  //--------------- GENERATED CODE------------------//
  def head[T1, T2](implicit m1: Manifest[T1], m2: Manifest[T2]) = head[(T1, T2)]
  def head[T1, T2, T3](implicit m1: Manifest[T1], m2: Manifest[T2], m3: Manifest[T3]) = head[(T1, T2, T3)]
  def head[T1, T2, T3, T4](implicit m1: Manifest[T1], m2: Manifest[T2], m3: Manifest[T3], m4: Manifest[T4]) = head[(T1, T2, T3, T4)]
